import React, { Component } from 'react';
import './Modal.css';
export default class Test extends Component {
  onClose = (e) => {
    this.props.handleClose && this.props.handleClose(e);
  };
  render() {
    if (!this.props.showTest) {
      return null;
    }
    return (
      <div className="mod">
        <div className="mod-content">
          <div className="mod-header">
            <h4 className="mod-title">Test</h4>
          </div>
          <div className="mod-body">
            <div className="card bg-warning">
              <div className="table-responsive">
                <table
                  className="table table-striped table-sm table-success table-bordered"
                  data-link="row"
                >
                  <tbody>
                    <tr>
                      <td className="align-bottom font-weight-bold">
                        <label className="control-label">Product Name</label>
                      </td>
                      <td className="align-bottom">
                        <input
                          type="text"
                          name="ProductName"
                          id="ProductName"
                          placeholder="Product Name"
                          className="form-control"
                          value={this.props.productData.ProductName || ''}
                        />
                      </td>
                    </tr>

                    <tr>
                      <td colSpan="2">
                        <button
                          className="btn btn-sm btn-danger fa-pull-right"
                          onClick={this.onClose}
                        >
                          Close
                        </button>
                      </td>
                    </tr>
                  </tbody>
                </table>
              </div>
            </div>
          </div>
          <div className="mod-footer"></div>
        </div>
      </div>
    );
  }
}
